import {
	ADD_FACE_BOX,
	ON_INPUT_CHANGE
} from './constants.js'

export const addFaceBox = (box) => ({
	type: ADD_FACE_BOX,
	payload: box
})

export const changeInput = (input) => ({
	type: ON_INPUT_CHANGE,
	payload: input
})

export const updateUserInfo = (data) => ({
	type: LOAD_DATA,
	payload: data
})
